INSERT INTO `content` VALUES (1, '<p>33333333<br></p>');
INSERT INTO `content` VALUES (2, '<p><b>先通过来一些概念</b>，<font color=\"#f9963b\">会让我们对技术有着更加清晰的理解</font>。J2EE笨重的开发、繁多的配置、低下的开发效率、复杂的部署流程、第三方技术集成难度大，如果开发过SpringMVC或者单纯使用过SSH、SSM框架的同学，肯定是体验过被很多配置文件支配的恐惧，很难受吧，不过不用担心，我们有了SpringBoot。Spring Boot用来简化Spring应用开发，约定大于配置，去繁从简，just run就能创建一个独立的，产品级别的应用。随着Spring全家桶时代的到来，SpringBoot给我们带来了J2EE一站式解决方案，SpringCloud给我们带来了分布式整体解决方案。从此我们可以使用 SpringBoot 快速的开发基于 Spring 框架的项目，由于围绕 SpringBoot 存在很多开箱即用的 Starter 依赖，使得我们在开发业务代码时能够非常方便的、不需要过多关注框架的配置，而只需要关注业务即可。<br><img src=\"data:image/jpeg;base64,\" style=\"max-width:100%;\"><br></p>');
INSERT INTO `content` VALUES (3, '');
INSERT INTO `content` VALUES (107429683221630976, '');
INSERT INTO `content` VALUES (107431070760308736, '<p style=\"text-align:center;\">快速创建独立运行的Spring项目以及与主流框架集成<br>使用嵌入式的Servlet容器，应用无需打成WAR包<br>starters自动依赖与版本控制<br>大量的自动配置，简化开发，也可以修改默认值<br>无需配置XML，无代码生成，开箱即用<br>准生产环境的运行时应用监控<br>与云计算的天然集成<br>看到SpringBoot这么多优点，是不是很想立刻上手呢，先不急。这里还是要提一下的，SpringBoot入门很容易，不过想要精通还是有难度的，因为毕竟自动化帮我们把Spring全家桶集成的这么好，我们想要深入精通的话，必须要了解Spring全家桶的技术，当然难呀，不过既然好上手，我们完全可以先学会怎么使用，然后后面熟练了再去研究底层代码原理，这样才有那种豁然开让的感觉。<br><br></p>');
INSERT INTO `content` VALUES (107431212074799104, '<p>说到SpringBoot，就不得不提一下微服务，微服务是一种架构风格，可以理解成小型服务，这些服务通过HTTP的方式进行互通。微服务并没有一个官方的定义，想要直接描述微服务比较困难，我们可以通过对比传统WEB应用，来理解什么是微服务，传统的应用成为“单体应用”<br><br>单体应用就是那种，核心分为业务逻辑、适配器以及API或通过UI访问的WEB界面。业务逻辑定义业务流程、业务规则以及领域实体。适配器包括数据库访问组件、消息组件以及访问接口等，所有的这些东西都集成在一起，看着很强大，其实很乱。<br><br>而微服务架构有很多重要的优点，它解决的就是复杂性问题。它将单体应用分解为一组服务。虽然功能总量不变，但应用程序已被分解为可管理的模块或服务。这些服务定义了明确的RPC或消息驱动的API边界。微服务架构强化了应用模块化的水平，而这通过单体代码库很难实现。因此，微服务开发的速度要快很多，更容易理解和维护。<br><br></p>');
INSERT INTO `content` VALUES (107431343037747200, '<p>说了这么多SprigBoot多好多好，不直接上手一个简单的项目说不过去，那我们就来创建运行一个HelloWord应用，体验一些从创建到访问http://localhost:8080/hello有多么的简单，你就会意识到原先的SpringMVC以及SSH什么的有多么繁琐。<br>这里说一下，我们先上手一个简单的应用，然后我会基于这个简单的应用说明一些SpringBoot的配置和使用，正所谓先要尝到甜头，才有学习的动力嘛，废话不多说，上手。<br><br></p>');
INSERT INTO `content` VALUES (107431415439822848, '<p>环境啥的其实，也不用多说，因为和我使用的不同版本其实也不会有太大影响，只是可能一些问题是因为版本引起的。<br><br>JDK1.8：1.8的版本很好用，目前大部分公司生产环境的项目也都是1.8<br>SpringBoot1.7以上：我这里使用的SpringBoot2.2.4<br>Maven3.3以上：我这里使用的是3.5.4<br>IDE使用的Idea（用eclipse也可以，不过我使用的是Idea演示<br><br></p>');
